import styled from 'styled-components';

export default function Login (props) {
    return(
        <div>
            <Background />
            <Container>
                <h1>Login</h1>
            </Container>
        </div>
    );
}

const Container = styled.div`
    background-color:red;
`
function Background () {
    return(
        <Background>
            <svg src="../public/login-bg.svg"></svg>
        </Background>
    );
}
